This is an #ad for Mattel. Polly Pocket is available at Walmart, Target and Amazon. Polly Pocket Sparkle Cove Adventure can be streamed on Netflix US starting August 21st. 

Jannie, Wendy, and Ellie play with Polly Pocket Sparkle Cove toys and go on a treasure hunt adventure to learn the importance of teamwork, problem-solving, and creative thinking. It also encourages them to use their imagination and play creatively, demonstrating that adventures can be found in everyday surroundings.
@MATTEL #PollyPocket

